    /**
     * @return bool|void
     * @throws \Adv\Bitrixtools\Exception\IblockNotFoundException
     * @throws \Bitrix\Main\ObjectException
     * @throws \FourPaws\PersonalBundle\Exception\InvalidArgumentException
     */
    public function up(){
        $helper = new HelperManager();

        // Добавление персонального предложения
        $result = $helper->Iblock()->addElementIfNotExists(
            IblockUtils::getIblockId(IblockType::PUBLICATION, IblockCode::PERSONAL_OFFERS),
            [
                'NAME' => 'test 20% 20-му покупателю',
                'CODE' => PersonalOffersService::NTH_BASKET_OFFER_ID
            ],
            [
                'DISCOUNT' => 20,
                'IS_UNRESTRICTED_ACTIVITY' => true,
            ]
        );

        // Добавление купонов в пул
        $personalOfferId = ElementTable::query()
            ->setFilter([
                'CODE' => PersonalOffersService::NTH_BASKET_OFFER_ID,
                'IBLOCK_ID' => IblockUtils::getIblockId(IblockType::PUBLICATION, IblockCode::PERSONAL_OFFERS),
            ])
            ->setSelect(['ID', 'IBLOCK_ID'])
            ->exec()
            ->fetch()['ID'];

        if ($personalOfferId) {
            /** @var CouponPoolRepository $repository */
            $repository = Application::getInstance()->getContainer()->get('coupon_pool.repository');

            $repository->add($personalOfferId, $this->promoCodes);
        }
    }

    public function down(){
        $helper = new HelperManager();

        global $APPLICATION;
        $APPLICATION->ThrowException('Операция удаления купонов при необходимости должна выполняться вручную.');
        return false;
    }

